INSERT INTO `jokes` (`id`, `title`, `content`, `rating`, `votes`, `url`, `comments_count`) VALUES
(1, 'Clean Restaurant Joke', 'So these two roaches, Tom and Oscar, are hanging out next to a dumpster enjoying a snack. “Hey Tom” said Oscar  to his friend, “You know that restaurant down the block? I went there yesterday to pick up some scraps, and I couldn’t believe how clean it was, I could practically see my reflection through the shiny waxed floor.” “Oscar” hollered Tom spitting the food out of his mouth, “please not while I am eating!!”', 2.3, 522, 'http://www.greatcleanjokes.com/2779/roach-joke/', 17),
(2, 'Lawyers Daughter Joke', 'Q. What did the lawyer name his daughter?', 3.4, 386, 'http://www.greatcleanjokes.com/2083/lawyers-daughter-joke/', 4),
(3, 'Hilarious Video –  About Phobias', NULL, 4.3, 114, 'http://www.greatcleanjokes.com/1269/hillarious-video-about-phobias/', 10),
(4, 'Surgery Joke', 'Before going in for surgery I thought it would be funny if I posted a note on myself telling the surgeon to be careful. After the surgery I found another note on myself .”Anyone know where my cell phone is????????”', 2.8, 236, 'http://www.greatcleanjokes.com/632/632/', 5),
(5, 'Heaven Joke', 'A man died and went to The Judgment, they told him , “Before you meet with God,  I should tell you — we’ve looked over your life, and to be honest you really didn’t do anything particularly good or bad. We’re not really sure what to do with you. Can you tell us anything you did that can help us make a decision?”', 4.2, 671, 'http://www.greatcleanjokes.com/497/497/', 12),
(6, 'Memory Problems Joke', 'A few old couples used to get together to talk about life and to have a good time. One day one of the men, Harry, started talking about this fantastic restaurant he went to the other night with his wife. “Really?”, one of the men said, what’s it called? After thinking for a few seconds the Harry said, “what are those good smelling flowers called again?” “Do you mean a rose? the first man questioned. “Yes that’s it,” he exclaimed. Looking over at his wife he said, “Rose what’s that restaurant we went to the other night?”', 4.1, 191, 'http://www.greatcleanjokes.com/427/memory-problems/', 3),
(7, 'Can You Hear Me??????', 'An old man went to the Doctor complaining that his wife could barely hear. The Doctor suggested a test to find out the extent of the problem. “Stand far behind her and ask her a question, and then slowly move up and see how far away you are when she first responds.” The old man excited to finally be working on a solution for the problem, runs home and sees his wife preparing supper. ” Honey” the man asks standing around 20 feet away “whats for supper?” After receiving no response he tried it again 15 feet away, and again no response. Then again at 10 feet away and again no response. Finally he was 5 feet away “', 4.2, 439, 'http://www.greatcleanjokes.com/282/funny-speach-opener-2/', 10),
(8, 'The Forgetful Actor', 'An actor had been out of work for 15 years because he always forgot his lines. Then one day he got a phone call from a director who wanted him for a big part in a play. All he had to say was “Hark! I hear the cannon roar! After much worry the actor decided to take  the role. Opening night arrived, and while he waited in the wings, the actor muttered to himself “Hark! I hear the cannon roar! Hark! I hear the cannon roar! The time for the entrance finally came and as the actor made his appearance, he heard a loud brooooom! He turned around and said, “what the hell was that?” -Robert De Nero', 3.3, 164, 'http://www.greatcleanjokes.com/143/funny-speach-opener/', 4),
(9, 'Woops Sorry About That', 'Marvin, was in the hospital on his death bed. The family called Marvin’s Preacher to be with him in his final moments. As the Preacher stood by the bed, Marvin’s condition seemed to deteriorate, and Marvin motioned for someone to quickly pass him a pen and paper. The Preacher quickly got a pen and paper and lovingly handed it to Marvin. But before he had a chance to read the note, Marvin died. The Preacher feeling that now wasn’t the right time to read it put the note in his jacket pocket. It was at the funeral while speaking that the Preacher suddenly remembered the note. Reaching deep into his pocket the Preacher said “and you know what, I suddenly remembered that right before Marvin died he handed me a note, and knowing Marvin I’m sure it was something inspiring that we can all gain from. With that introduction the Preacher ripped out the note and opened it.', 4.3, 710, 'http://www.greatcleanjokes.com/139/funny-speach-openers/', 19),
(10, 'The “Bottom”', 'Q.What has a bottom at its top?', 3.8, 152, 'http://www.greatcleanjokes.com/86/short-joke-4/', 2),
(11, 'Dying Fears Joke', 'Adam woke up suddenly, sweating all over.  ”What’s the problem”, asked his wife.  ”Are you OK?”   “I just dreamed that I died!”  responded a shaken Adam.  ”And it was so bad up there, and that’s why you’re sweating all over?”  asked his wife.  ”You bet!”  exclaimed Adam.  ”I got up there, and was right in front of G-d himself, when he suddenly sneezed…..and I didn’t know what to say to him!  Whoa was that traumatic!”', 2.6, 79, 'http://www.greatcleanjokes.com/3742/dying-fears-joke/', 0),
(12, 'Money Talks Joke', 'Eddy was just a regular guy. Except for the fact that he was an only child and the fact that his billionaire father was breathing his last. ', 2.7, 50, 'http://www.greatcleanjokes.com/3394/money-talks-joke/', 2),
(13, 'Last Wishes Joke', 'Old Max had started out as a diamond cutter, and through hard work and good judgement he finally became the owner of a National chain of jewelry stores.  He was wealthy indeed.  ', 2.8, 46, 'http://www.greatcleanjokes.com/3212/last-wishes-joke/', 0),
(14, 'Hearse Joke', 'Jim grabbed his suitcase off the luggage carousel and headed outside to hail a taxi. A taxi promptly picked him up and they were on there way. Twenty minutes into the ride Jim had a question for the taxi driver, “Excuse me sir” said Jim tapping the driver on the shoulder. “AHHHH', 4, 78, 'http://www.greatcleanjokes.com/3160/hearse-joke/', 0),
(15, 'Last Wish Joke', 'Anne was on her deathbed breathing her last. “Anne”, said Anne’s husband Jim. “Please, please,tell me, is there anything I can do for you?” “Well” croaked Anne, “There is something. After I die, it would mean so much to me if you would marry my best friend Sandra.”  “You have nothing to worry about Anne” said Jim taking her hand, “I’ve been thinking about that for a while now already.”', 3.2, 45, 'http://www.greatcleanjokes.com/3140/last-wish-joke/', 0),
(16, 'Deathbed Joke', 'Edward was lying on his deathbed and the family was taking turns spending time with him.    As he was speaking to his young granddaughter Emily, Edward suddenly smelled an all too familiar smell.  Why it was his favorite – apple pie!  His wife Sandy must have been baking it for him to enjoy this one last time.  “Emily dear,” asked Edward.  “Would you please go ask Grandma for a slice of that Apple Pie?  It’s smells so delicious!”  Emily ran off to fulfill her dying Grandfather’s last wish.  A moment later, Emily returned empty handed.  “Where’s my pie?”  questioned Edward.  “Grandma said it’s not for now” responded Emily, “it’s for the funeral”.', 3.6, 48, 'http://www.greatcleanjokes.com/3101/deathbed-joke/', 0),
(17, 'The Execution Joke', 'Three men, a Frenchman, an Italian, and a Jew, were condemned to be executed. Their captors told them that they had the right to have a final meal before the execution. They asked the Frenchman what he wanted.', 4.2, 281, 'http://www.greatcleanjokes.com/137/jewish-humor/', 7),
(18, 'Flowers Joke', '“What the heck is going on here?” said an angry  man storming into the florist shop. “I just lost one of my main clients and it’s your fault!”', 3.5, 54, 'http://www.greatcleanjokes.com/3520/flowers-joke/', 0),
(19, 'Enough Is Enough', 'My old aunts  used to come up to me at weddings, poking me in the ribs and cackling,  “You’re next!”', 4.1, 291, 'http://www.greatcleanjokes.com/1570/enough-is-enough/', 2),
(20, '5 Best  Pick-up Line Comebacks', 'Man – Haven’t I seen you someplace before?', 3.8, 163, 'http://www.greatcleanjokes.com/3522/5-best-pick-up-line-comebacks/', 0),
(21, 'Wanna Date Comeback', 'Man – “So do you want to go out maybe?”', 3, 195, 'http://www.greatcleanjokes.com/2061/wanna-date-comeback/', 1),
(22, 'Homework Joke', 'PUPIL – “Would you punish me for something I didn’t do?”', 4.2, 651, 'http://www.greatcleanjokes.com/2055/homework-joke/', 12),
(23, 'Getting Overpaid Joke', 'An employee approached his boss regarding a dispute on his pay-check…', 3.5, 227, 'http://www.greatcleanjokes.com/2053/getting-overpaid-joke/', 3),
(24, 'Relative Joke', 'Wife – You hate my relatives!', 3.9, 165, 'http://www.greatcleanjokes.com/2048/relative-joke/', 2),
(25, 'You Smell Comeback', 'Person#1: Why do you smell funny?', 4, 131, 'http://www.greatcleanjokes.com/1857/you-smell-comeback/', 1),
(26, 'Dance Refusal Comeback', 'Man- Do you want to dance?', 3.8, 192, 'http://www.greatcleanjokes.com/1855/dance-refusal-comeback/', 0),
(27, 'Boy Girl Joke', 'Boy – Would you like to dance?', 3.5, 81, 'http://www.greatcleanjokes.com/3745/boy-girl-joke/', 0),
(28, 'Employee Insults', '“Since my last report, this employee has reached rock bottom and has started to dig.”', 3.7, 33, 'http://www.greatcleanjokes.com/3384/employee-insults/', 0),
(29, 'Bad Example Joke', 'You are not totally useless, you can be used as an bad example!', 3.5, 175, 'http://www.greatcleanjokes.com/2417/bad-example-joke/', 4),
(30, 'Nature Joke', 'It’s amazing you love nature so much in spite of what it did to you.', 3.5, 94, 'http://www.greatcleanjokes.com/2312/nature-joke/', 2),
(31, 'Dark And Handsome Joke', 'You are dark and handsome; when it’s dark, you are handsome.', 3.6, 103, 'http://www.greatcleanjokes.com/2189/dark-and-handsome-joke/', 2),
(32, 'Crayon Joke', 'I’d explain it to you, but I don’t have any crayons with me.', 3.1, 95, 'http://www.greatcleanjokes.com/2116/crayon-joke/', 0),
(33, 'Psychology Joke', 'I would probably find you more interesting had I studied psychology. ', 2.7, 40, 'http://www.greatcleanjokes.com/2114/psychology-joke/', 2),
(34, 'Happiness Joke', 'Some people bring happiness wherever they go – you bring happiness whenever you go.', 3.6, 69, 'http://www.greatcleanjokes.com/2110/happiness-joke/', 0),
(35, 'Battle Of Wits Joke', 'I’m sorry, I refuse to have A battle of wits with an unarmed person.', 3.8, 43, 'http://www.greatcleanjokes.com/2069/battle-of-wits-joke/', 1),
(36, 'Good Looks Insult', 'Someday you may lose your hair, you may lose your teeth, your money and even lose your mind. But one thing you will never lose – your good looks, coz you can never lose what you don’t have! ', 4.2, 145, 'http://www.greatcleanjokes.com/1960/good-looks-insult/', 0),
(37, 'Slow Person Insult', 'The closest she/he’ll ever get to a brainstorm is a slight drizzle.', 3.5, 39, 'http://www.greatcleanjokes.com/1861/slow-person-insult/', 0),
(38, 'Stupid Person Insult', 'It’s hard to get the big picture when you have such a small screen. ', 3.1, 36, 'http://www.greatcleanjokes.com/1859/stupid-person-insult/', 0),
(39, 'I’m Busy Insult', 'I’m busy now. Can I ignore you some other time?', 4.2, 28, 'http://www.greatcleanjokes.com/1853/im-busy-insult/', 0),
(40, 'Being Yourself Insult', 'Anybody who told you to be yourself, simply couldn’t have given you worse advice.', 3.6, 28, 'http://www.greatcleanjokes.com/1851/being-yourself-insult/', 0),
(41, 'Hairy Insult', 'Next time you shave, try standing an inch or two closer to the blade.', 3.6, 28, 'http://www.greatcleanjokes.com/1849/hairy-insult/', 1),
(42, 'Banana Joke', 'Yo Mamma has such a big mouth; she could eat a banana sideways.', 3.2, 190, 'http://www.greatcleanjokes.com/2112/banana-joke-2/', 1),
(43, 'The Menu Joke', 'Yo mama is so fat she goes to a restaurant, looks at the menu and says “okay!”', 3, 163, 'http://www.greatcleanjokes.com/183/yo-mama-joke-3/', 6),
(44, 'Chubby Mama', 'yo mama is so fat people jog around her for exercise.', 3.6, 114, 'http://www.greatcleanjokes.com/180/yo-mama-joke-2/', 1),
(45, 'The Fat Fat Mama Joke', 'yo mama is so fat that when she steps on the scale it says to be continued.', 4, 132, 'http://www.greatcleanjokes.com/177/yo-mama-joke/', 0),
(46, 'The Ugly Mama Joke', 'Yo mama is so ugly that they push her face into dough to make gorilla cookies.', 3.9, 97, 'http://www.greatcleanjokes.com/167/knock-knock-joke-2/', 2),
(47, 'The Mail Box Joke', 'Yo momma is so dumb, she runs out and checks her mail box every time AOL tells her, “You’ve got mail!”', 3.2, 147, 'http://www.greatcleanjokes.com/121/yo-mama/', 1),
(48, 'Medical History Joke', 'Due to a job transfer, Brian moved from his hometown to New York City.  Being that he had a very comprehensive health history, he brought along all of his medical paperwork, when it came time for his first check up with his new Doctor.', 3.4, 25, 'http://www.greatcleanjokes.com/3802/medical-history-joke/', 0),
(49, 'Hypochondriac Joke', 'Brian, one of the worlds greatest hypochondriacs, bumped into his Dr. one day at the supermarket.  ', 3.7, 45, 'http://www.greatcleanjokes.com/3482/hypochondriac-joke/', 1),
(50, 'Alcohol Joke', 'Doctor: “I am not exactly sure of the cause. I think it could be due to alcohol.”', 3.4, 55, 'http://www.greatcleanjokes.com/3153/alcohol-joke/', 0),
(51, 'Enjoy Life Joke', 'Sam goes to the doctor for his yearly checkup. “Everything is fine”, said the doctor, “You’re doing OK for your age.” “For my age?” questioned Sam, “I’m only 75, do you think I’ll make it to 80? “Well” said the doctor, “do you drink or smoke?” “No” Sam replied. “Do you eat fatty meat or sweets?” “No” said Sam “I am very careful  about what I eat.” “How about your activities? Do you engage in thrilling behaviors like speeding or skiing? “No” said Sam taken aback, “I would never engage in dangerous activities.” “Well,” said the doctor, “then why in the world would you want to live to be 80?', 3.3, 140, 'http://www.greatcleanjokes.com/2731/enjoy-life-joke/', 5),
(52, 'Worried Mom Joke', 'Mother – I need to speak to the doctor, it’s an emergency, my infant has a temperature of 101.', 2.5, 118, 'http://www.greatcleanjokes.com/2576/worried-mom-joke/', 0),
(53, 'Eye Doctor Joke', 'I was very scared about going to the eye doctor to get a certain procedure done on my eyes. The doctor tried to put me at ease but to no avail. It was after he finished with my first eye that I nearly jumped out of the chair. “There there”, he said “only one eye left!”', 2.5, 152, 'http://www.greatcleanjokes.com/2503/eye-doctor-joke-2/', 4),
(54, 'Alzheimer’s Joke', 'So this old man goes to the doctor and the doctor says, “You’re test', 3.2, 127, 'http://www.greatcleanjokes.com/2441/alzheimers-joke/', 0),
(55, 'Blood Pressure Joke', 'A doctor remarked on his patients, ruddy complexion. “I know” the patient said “It’s high blood pressure, it’s from my family. “Your mother’s side, or father’s side?” questioned the doctor. Neither, my wife’s. “What?” the doctor said “that can’t be, how can you get it from your wife’s family?” “Oh yeah,” the patient responded, ', 3.1, 83, 'http://www.greatcleanjokes.com/1581/blood-preasure-joke/', 0),
(56, 'Just Being Practical', 'A man wasn’t feeling well so he went to the doctor.  After examining him the doctor took his wife aside, and said, “your husband has a very sensitive heart. I am afraid he’s not going to make it, unless you treat him like a king, which means you are at his every beck and call, 24 hours a day and that he doesn’t have to do anything himself. On the way home the husband asked with a note of concern “what did he say?” “Well”, the lady responded, “', 4, 102, 'http://www.greatcleanjokes.com/1339/just-being-practical/', 2),
(57, 'Pregenant?', 'A lady went to a doctor’s office where she was seen by a Doctor. A few minutes into the examination, screeching could be heard from the room, and then the lady burst out of the room as if running for her life. After much effort a nurse finally managed to calm her down enough to tell her story. The nurse barged into the office of the Doctor and screamed, “shame on you, Mrs. Smith is 82 years old, and you told her she’s pregnant.” The Doctor continued writing calmly and barely looking  up said, “does she still have the hiccups?”', 3.9, 87, 'http://www.greatcleanjokes.com/501/pregenant-doctor-joke/', 1),
(58, 'The Revenge On The Doctor', 'A colleague and I were fitting clothes for a fashion show benefit. All the models were residents of our small town, including the local doctor. He tried on one outfit and then asked, “what should I do next?” gleefully seizing the  opportunity my friend replied, “go to the dressing room remove your clothes put on a paper robe and wait.”  -Terry L. Roschak', 2.6, 71, 'http://www.greatcleanjokes.com/59/funny-story/', 0),
(59, 'Injury Joke', 'Did you here about the guy who lost his whole left side?', 3.8, 408, 'http://www.greatcleanjokes.com/2276/injury-joke/', 1),
(60, 'Nervous Dad Joke', '“Just relax”, the hospital staff kept telling Jim, but it was to no avail. Jim’s wife was in labor and Jim was a nervous wreck. After what seemed like a week, to both Jim and the hospital staff, a nurse came out with the happy news, “it’s a girl”, she cried. “Thank G-d, a girl”, said Jim, “at least she won’t have to go through what I just went through!”', 3.4, 84, 'http://www.greatcleanjokes.com/2695/nervous-dad-joke/', 4),
(61, 'Iron Joke', 'A blond man entered the emergency room with his two ears burned. “What happened?” asked the doctor. “Well”, the man explained, “my wife was ironing clothing, behind my chair while I was watching TV. She put down the iron next to the phone and when the phone rang I answered the iron.” ', 3.6, 151, 'http://www.greatcleanjokes.com/1584/1584/', 1),
(62, 'Poor Husband Joke', 'Sally walked in to the Dentist office to make an appointment. “How much do you charge to pull out a tooth?” She asked.” “It’s $130″, was the prompt reply. “$130!” gasped Sally, that’s ridiculous! There must be a way for you to go cheaper.” “Well,” said the Dentist thoughtfully, I suppose if we don’t numb it, we could knock off $30.” “Only $30?,” countered Sally, “that’s still $100, you’ve got to make it cheaper.” “Well,” said the Dentist after a long pause, “I suppose if we take it out with a wrench we could knock it down to $50.” “Perfect”, said Sally happily. “I would like to make an appointment for next Tuesday, for my husband Jack.”', 3.7, 80, 'http://www.greatcleanjokes.com/2852/poor-husband-joke/', 6),
(63, 'Old Age Joke', 'An Old man went to the doctor complaining of a terrible pain in his leg. “I am afraid it’s just old age”, replied the doctor, “there is nothing we can do about it.” “That can’t be” fumed the old man, “you don’t know what you are doing.” “How can you possibly know I am wrong?” countered the doctor. “Well it’s quite obvious,” the old man replied, “my other leg is fine, and it’s the exact same age!”         ', 3.5, 169, 'http://www.greatcleanjokes.com/1590/old-age-joke/', 1),
(64, 'Being Polite Joke', 'I work as a  pediatric nurse, and often have the painful job of giving shots to the children. One day upon  entering  the examining room to give a shot the  little girl starting screaming “NO! NO! NO!”', 3.6, 172, 'http://www.greatcleanjokes.com/1588/being-polite-joke/', 5),
(65, 'OOPS?', 'Jerry was in the hospital recovering from  surgery when a nurse asks him how he is feeling.', 3.7, 159, 'http://www.greatcleanjokes.com/1579/oops/', 5),
(66, 'Best Friend Joke', 'Mark was passing by the bar on the way home from  work when he sees his good friend Tom gulping down one shot after another.', 3, 62, 'http://www.greatcleanjokes.com/3535/best-friend-joke/', 0),
(67, 'Bar Excuse Joke', 'Harry was sick and tired of being constantly badgered by his wife Barbara for spending so much time at the bar. Hoping it would help matters, Harry invited Barbara along with him.', 3.1, 46, 'http://www.greatcleanjokes.com/3332/bar-excuse-joke/', 0),
(68, 'Parrot Joke', 'So this Chinese fellow walks into a bar with a huge colorful parrot on his shoulder. “Wow”, says the bartender, “where did you get that from?” “From China”, answered the parrot, “they’ve got tons of them there!” ', 3.2, 86, 'http://www.greatcleanjokes.com/2735/parrot-joke/', 0),
(69, 'Mushroom Bar Joke', 'A mushroom walks into a bar and orders a drink.', 2.9, 97, 'http://www.greatcleanjokes.com/2644/mushroom-bar-joke/', 3),
(70, 'Ouch Joke', 'Two guys walk into a bar. The third one ducks.', 3.2, 43, 'http://www.greatcleanjokes.com/2450/ouch-joke/', 0),
(71, 'The Bar Joke', 'A man walks into a bar obviously stone drunk, and asks for a drink. Sorry the bartender but you obviously already had a little to much to drink. Fuming mad the drunk walks out the front door and walks into the side door. “Can I have a drink please.”  “Sorry” the bartender says “but you can’t have a drink here.” The drink walks out and goes in through the back door. “Can I please have a drink.” “Enough!” The bartender screamed “I told You No Drinks!” The Drunk looks at the bartender closely and exclaimed “Darn! how many bars you work at.”   ', 3.6, 150, 'http://www.greatcleanjokes.com/615/confused-drunk/', 2),
(72, 'Cold Turkey Joke', 'Lady – “So do you drink?”', 3.1, 50, 'http://www.greatcleanjokes.com/2689/cold-turkey-joke/', 1),
(73, 'Beer Beer Beer Joke', '24 hours in a day … 24 beers in a case …coincidence?', 2.8, 36, 'http://www.greatcleanjokes.com/2259/beer-beer-beer-joke/', 0),
(74, 'Cooler Joke', 'Men are like coolers – Load them with beer, and you can take them anywhere.', 2.8, 19, 'http://www.greatcleanjokes.com/2105/cooler-joke/', 0),
(75, 'Balanced Diet Joke', 'Q. What’s a man’s idea of a balanced diet?', 3.5, 17, 'http://www.greatcleanjokes.com/2044/balanced-diet-joke/', 0),
(76, 'Beauty Joke', 'Beauty is in the eye of the beer holder. ', 3.6, 15, 'http://www.greatcleanjokes.com/1988/beauty-joke/', 0),
(77, 'What Do Beer And Women Have In Common?', 'Scientists recently discovered that beer contains small traces of female hormones. This was proven by giving 100 men 12 pints of beer and observed that an astonishing percentage, 100%, started  talking nonsense and couldn’t drive.', 3.6, 93, 'http://www.greatcleanjokes.com/1632/what-does-beer-and-women-have-in-common/', 2),
(78, 'Snail Joke', 'Tom’s wife was hosting a dinner party for some of her close friends, at their summer home.  Moment’s before the guests were scheduled to arrive, she asked Tom if he would be ever so gracious to walk a block down to the beach to pick up some fresh snails for the party.  On his way to the beach he passed the local bar, and figured he’d stop in for a quick drink before heading down to the beach to search for the snails.  ', 3.9, 46, 'http://www.greatcleanjokes.com/3382/snail-joke/', 0),
(79, 'Cemetery Joke', '‘Bob’s Tavern’ was right next door to a cemetery. One day in mid winter a drunk stumbled out of the tavern. Due to his drunk state he wasn’t careful where he was going and he fell into a freshly dug grave. “Help!” Screamed the drunk on the top of his lungs, “I’m freezing!”', 4, 22, 'http://www.greatcleanjokes.com/3326/cemetery-joke/', 0),
(80, 'Drunkard Joke', 'The poor man was such a habitual drinker that even he was finally convinced that he was an alcoholic . At his family’s urging he went to see a psychiatrist. After a lengthy consultation, the doctor sternly ordered that hereafter, every time the patient got drunk he was to report his transgression the very next day.', 4, 20, 'http://www.greatcleanjokes.com/3195/drunkard-joke/', 0),
(81, 'Nasty Wife Joke', 'A cop pulled over a car and finds a young couple in the front seat.  “Where’s your seat belt young man?” asked the cop.  “Oh, I just took if off now when you were walking up to the car”, responded the man.  “No you didn’t!” exclaimed his wife, “you never wear your seat belt!”.  A little taken aback, the cop asked to see his license.  “Aw shucks!” cried the man, “I must have left it home!” “Yeah right!” screamed his wife, “You know it expired 3 months ago!”  At a loss for words, the cop asked the woman “are you always so tough on him?!” “No” responded the young woman, “only when he had too much to drink!”.', 3.2, 42, 'http://www.greatcleanjokes.com/3001/nasty-wife-joke/', 0),
(82, 'Walk The Line Joke', 'A cop is doing standard patrol when he notices a car swerving all over the road. He quickly turns on his siren and pulls the guy over. “Alright,” says the cop, when the man gets out of the car. “Walk in a straight line.” “I’d be happy to,” says the drunk “just stop moving the stupid line.”', 3.9, 110, 'http://www.greatcleanjokes.com/2727/walk-the-line-joke/', 5),
(83, 'Crazy Drunk Joke', 'Jeff was fast asleep in his at bed at 3:00 am when he heard an urgent knocking at the door. Rubbing the sleep out of his eyes he made his way to the door. “Can you give me a push”, asked the man at the door.” Jeff looked at the man, thinking he looked a bit drunk, slammed the door in his face and went back to bed. “Shame on you”, said his wife Sally, when hearing the story. “You remember on our vacation how our car got stuck in the middle of the night and that man helped us, go out there and push his car.” So Jeff trudges back out of bed, opens the door, and calls out “Ok I’m here to give you a push, where are you?” I’m over here in the back” came the voice “on the swing.”', 3.4, 134, 'http://www.greatcleanjokes.com/2706/crazy-drunk-joke/', 5),
(84, 'Funny Throwing Up Video', NULL, 3.3, 27, 'http://www.greatcleanjokes.com/2692/funny-throwing-up-video/', 1),
(85, 'Drunk Driving Joke', 'Jim’s car is swerving all over the road so a cop pulls him over, “Step out of the car” says the cop, “I am going to need you to take a  breathalyzer test.” “I can’t”, Jim responds “You see I have very bad asthma, that can set off an attack.” ', 4.1, 350, 'http://www.greatcleanjokes.com/2658/drunk-driving-joke/', 10),
