(278, 'Grandma Joke', '“Hi! My name is Gertrude,” said the lady next to him on the plane.  ”It’s so nice to meet you! I’m flying to New York for my grandson’s third birthday. I’m so excited! I remember when he was just a little thumbkin and now he’s already three!  It’s really hard to believe. He’s the most adorable thing you’ve ever seen! You know what?  Hold on, I think I might have a picture on me.  Let me take a look in my purse, yes, here it is, just look at him, isn’t he adorable. Do you see his dimple on his left cheek? Simply adorable! I could stare at his picture all day.', 2.5, 243, 'http://www.greatcleanjokes.com/3594/grandma-joke-3/', 0),
(279, 'Dead Dog Joke', 'Joe was a steward for Fly High airlines. He watched as an older lady boarded the plane holding a dog in a cage. “Excuse me,” said Joe “dogs are not allowed on board, you have to check it in with the baggage.” The lady wasn’t happy, but Joe was an experienced steward and succeeded in convincing the lady without much of a scene.  Upon arrival, Joe took a peek in the cage, and to his great surprise, saw that the dog was dead! Frantic that they may get sued, Joe quickly sent one of his underlings out to town to buy a dog that looked exactly the same. Just in the nick of time the underling arrived with the dog  They quickly switched dogs and breathed a sigh of relief. “This isn’t my dog!” said the lady as soon as she saw it. “I’m sure it is” insisted Joe “I was very careful about where I put it.” “It’s not my dog” argued the lady, “you see, I was bringing my dog to my home town to have him buried, and this dog is alive!”', 3.6, 27, 'http://www.greatcleanjokes.com/3004/dead-dog-joke/', 0),
(280, 'Flying Joke', 'Larry was a photographer for the N.Y. Times, and was scheduled to meet a plane on the runway to take him on a job. “Hit it,” said Larry climbing into the first plane he saw on the runway. The pilot took off, and was soon in the air. “OK,” said Larry, “fly low over the trees over there, I want to take a few pictures.” “What do you mean?” asked the pilot. Larry looked at the pilot and answered a little annoyed, “I need to take some pictures for the N.Y. Times, so please…..”   There was a long pause, before the pilot asked in a shaky voice, “you mean you’re not my pilot instructor?”', 4.2, 48, 'http://www.greatcleanjokes.com/2744/flying-joke-2/', 1),
(281, 'No Smoking Joke', 'A Stewardess upon noticing  that someone  clearly has been smoking in the bathroom. “I’m sorry sir” she said “but you’re not aloud to smoke on the plane,  if you want to smoke again please step out!”', 2.9, 56, 'http://www.greatcleanjokes.com/820/no-smoking-means-no-smoking/', 0),
(282, 'Birthday Invitation Joke', 'Birthday Invitation:', 2.4, 114, 'http://www.greatcleanjokes.com/2631/birthday-invitation-joke/', 1),
(283, 'Happy Birthday Joke', 'After much convincing from my husband, I finally agreed to call an old family friend to sing her happy birthday. It was only after I finished singing, that the voice at the other end of the line informed me, that it was the wrong number.', 3.3, 69, 'http://www.greatcleanjokes.com/1949/happy-birthday-joke/', 0),
(284, 'Kids And Fish Joke', 'For our daughters 6th birthday we bought her a fish. We couldn’t help laughing when on the way she announced “the fish’s name is Sparingly.” “How do you know?” I asked “look” she responded “it says “feed sparingly 3 times daily.” ', 3.6, 85, 'http://www.greatcleanjokes.com/1504/kids-and-fish-joke/', 0),
(285, 'Cold Shoulder Joke', 'Hey, you didn’t have to give me the cold shoulder!”', 3.8, 14, 'http://www.greatcleanjokes.com/3314/cold-shoulder-joke/', 0),
