(289, 'Cannibal Soup?', 'Two cannibals were having supper. “Your wife makes great soups” said one to the other. “Yes” agreed the first, “but I am going to miss her terribly.”', 3.7, 21, 'http://www.greatcleanjokes.com/760/good-food/', 0),
(290, 'Money Problems Joke', 'When the lodge meeting broke up, John confided to a friend. “Mike, I’m in a terrible pickle! I’m strapped for cash and I haven’t the slightest idea where I’m going to get it from!” “I’m glad to hear that” answered Mike. “I was afraid you might have an idea you could borrow it from me!”', 3.7, 15, 'http://www.greatcleanjokes.com/3166/money-problems-joke/', 0),
(291, 'Stock Market Joke', 'Q. What’s the best way to make a small fortune in the stock market?', 2.8, 35, 'http://www.greatcleanjokes.com/2342/stock-market-joke/', 0),
(292, 'Poor Economy Joke', 'I met a guy who’s a walking economy the front of his hair is in recession, his stomach is a terrible victim of inflation, and the combination together are putting him into a deep depression!', 2.6, 32, 'http://www.greatcleanjokes.com/663/times-are-tough/', 2),
(293, 'Hot Cakes', 'The economy is so bad, hot cakes aren’t even selling like  hot cakes anymore.                                                                                          Buzz Nutley', 4, 8, 'http://www.greatcleanjokes.com/462/hot-cakes-economy-jokes/', 0),
(294, 'Leftovers Joke', '“Oh no! not leftovers again!” complained my older sister when she saw the leftover meatloaf on the table from last nights supper.', 2, 56, 'http://www.greatcleanjokes.com/3986/leftovers-joke/', 0),
(295, 'Restaurant Joke', 'Sarah, Rosemary, and Anne went to a restaurant together to celebrate old times.', 2.8, 39, 'http://www.greatcleanjokes.com/3528/restaurant-joke/', 0),
(296, 'Diet Joke', 'A group of prosperous businessmen were dining at the Sam’s Hotel in Las Vegas.', 3.3, 19, 'http://www.greatcleanjokes.com/3181/diet-joke/', 0),
(297, 'Raising Kids Joke', 'Sandy and Norman were in despair.  Their 3 year old son Timmy still had not learned how to talk.  Not a word had escaped through those now 3 year old lips.  One night at dinner, Timmy took a taste of his pie, and to their utter surprise and amazement, said: “You call this pie?  It tastes like some tasteless mush!”.  Sandy and Norman sat there in shock, for this was not just their son’s first sentence, but the first words he ever uttered!  Once the initial shock had subsided, Norman asked “tell me Timmy, how come you never spoke until now?”  “I never had any reason to” explained Timmy.  “Everything was always fine.”', 3.5, 23, 'http://www.greatcleanjokes.com/2988/2988/', 0),
(298, 'Misunderstanding Joke', 'Jim was in a bad mood, and anyone who got in is way was going to regret it.  Jim walked into his favorite restaurant and plopped himself down on a chair.   “Get me a steak well done with mashed potatoes. ” Three minutes later when his order came, Jim screamed “DIDN’T YOU HEAR ME SAY WELL DONE?!” “Why thank you sir” the waitress smiled,  ”that was the first compliment I got all day!”', 3.3, 31, 'http://www.greatcleanjokes.com/2963/misunderstanding-joke-2/', 0),
(299, 'Pork Joke', 'The leader of the vegetarian society just couldn’t control himself anymore. He just needed to try some pork, just to see what it tasted like. So one summer day he told his members he was going on a vacation. He packed out of town, and headed to the nearest restaurant. After sitting down, he ordered a roasted pig, and impatiently waited for his delicacy.', 3, 220, 'http://www.greatcleanjokes.com/2603/pork-joke/', 4),
(300, 'A Drink Joke', 'Sam heard all about the great service in the “Sleep Fine Hotel”, so after dropping his stuff in his room, he excitedly headed down to the hotel lounge. He was only there for a few minutes when a beautifully dressed waiter came over to him. “Would you like something to drink?” she asked. Sam took in a deep breath, looked around at the beautiful lobby and asked “what are my choices?” The woman’s gave Sam a strange look, and responded in an extra loud and slow voice, “yeees or noooo.”', 3.1, 29, 'http://www.greatcleanjokes.com/2845/a-drink-joke/', 0),
(301, 'Funny Drive Through Video', NULL, 4.3, 86, 'http://www.greatcleanjokes.com/2661/funny-drive-through-video/', 3),
(302, 'Fries Joke', 'Man – “I would like some fries, please.', 2.8, 130, 'http://www.greatcleanjokes.com/2331/fries-joke/', 0),
(303, 'Double Portion Joke', 'Waiting hungrily on the lunch line, I eyed the hamburgers being served. Upon reaching the front of the line I asked, “excuse me, can I please have two burgers.” “You’ll get the same as everybody else,” the lady said in a bored voice. After hungrily eating my lunch, I walked to the garbage to throw out my plate, but I accidentally dropped my lunch tray in the garbage along with it. While I was digging in the garbage for my tray I felt a tap on my shoulder. “I’m sorry sonny” the lady said in a horror-stricken voice, “ here is another burger.”', 2.9, 36, 'http://www.greatcleanjokes.com/2316/double-portion-joke/', 0),
(304, 'Museum Joke', '“And this over here” croaked the 90 year old museum tour guide, “is a fossil 4 million and 69 years old, on it’s left you can see another fossil that’s 2 million and 69 years old.”', 3.4, 85, 'http://www.greatcleanjokes.com/3238/museum-joke/', 0),
(305, 'Heat Joke', 'It was during a heat wave in August one summer when I saw this sign on a telephone pole. “Garage sale this Sunday 7AM until 100 degrees.”', 2.7, 139, 'http://www.greatcleanjokes.com/1256/heat-joke/', 1),
(306, 'Used Clothing Joke', 'Always trying to save money, I often buy clothing for my kids from the garage sales. Recently, I purchased a new shirt from JC Penny for my 6 year old and was wondering why she was reluctant to wear it the next day. After asking her she responded,', 2.2, 61, 'http://www.greatcleanjokes.com/693/used-clothing/', 0),
(307, 'Travel Joke', 'An older couple were walking on a beach when the husband tripped over a bottle and a genie came out. “You can each have one wish,” said the genie. The wife made her wish first “I would like to travel around the world, with my husband,”. Suddenly there appeared in her hand two tickets for travel around the world. Now it was the husbands turn, “Well” said the husband, with a naughty look on his face “I wish I can have a younger companion,” . The words were barely out of his mouth when poof, ', 3.2, 62, 'http://www.greatcleanjokes.com/2265/travel-joke/', 0),
(308, 'Mean Boss Joke', 'The CEO of a large company was walking to the cafeteria along with two of his secretaries.  Upon tripping on a bottle, a genie appeared and asked the threesome if they would like to each make a wish.  ', 3.4, 125, 'http://www.greatcleanjokes.com/1418/boss-joke/', 0),
(309, 'Be Careful What You Wish For', 'A man rubbed a bottle and a genie came out, “OK the genie said what’s your wish” The man said “I want all ladies to love me”, and he turned into a bar of chocolate. ', 4.2, 42, 'http://www.greatcleanjokes.com/1104/be-careful-what-you-wish-for/', 2),
(310, 'Good Men Are Hard To Find!', 'A lady rubbed a bottle and a genie  popped out. “You have one wish” said the genie. “Hey” countered the lady “I thought I get three wishes?” “Not from  me” said the genie “I’m not that powerful.” “OK” responded the lady taking out a map, “I am making a wish for  peace between this country……… .” “I’m really sorry” said the genie,  “but I am not powerful enough for that.”  “That’s fine” said the lady, “instead I would like to find a cool, caring man, who loves children, and cooking.” The genie sighed and said “', 3.8, 56, 'http://www.greatcleanjokes.com/1046/good-men-are-hard-to-find/', 0),
(311, 'Kiss Joke', 'I lovingly gave my niece a kiss on her cheek upon seeing her at a family get-together.  Afterwards, I noticed her wiping her cheek.  ”Are you wiping off my kiss?”, I asked her.  ”No”, she smartly replied, “I’m just rubbing it in!”', 3.3, 171, 'http://www.greatcleanjokes.com/2651/kiss-joke/', 10),
(312, 'Back Seat Driver Joke', 'My daughter sure showed me what a back seat driver I am!  On our way to the mall today, I stopped short at a red light causing the car to jolt.  As soon as I jerked my 3 year old in the back seat hollered ', 2.8, 72, 'http://www.greatcleanjokes.com/2512/back-seat-driver-joke/', 0),
(313, 'Watch What You Say!', 'As a first grade teacher, I often hear from my students things going on in their family. Harry’s mother was expecting, and naturally Harry was very excited about it. When one day Harry stopped talking about it I was concerned and questioned him why. “Well”, Harry said, “my mother told me I could feel the baby moving in her stomach, ', 3.5, 157, 'http://www.greatcleanjokes.com/1722/watch-what-you-say/', 1),
(314, 'A Word From The Wise Joke', 'When my grandson asked me how old I was, I teasingly replied, “I’m not sure…” “Look in your underwear, Grandma,” he advised, “mine says I’m 4 to 6.” ', 3.8, 46, 'http://www.greatcleanjokes.com/1707/a-word-from-the-wise-joke/', 4),
(315, 'The Missing Boots', 'As part of my job as a preschool teacher I have to help the children put on their coats and boots. One day when school was over and the children were getting ready to leave, one child came over to me in tears “my boots are missing” she wailed. “they are in the corner” I said pointing to her boots. “Those are not mine!” she said, stamping her foot, ', 3.6, 57, 'http://www.greatcleanjokes.com/1525/the-missing-boots/', 0),
(316, 'Playing Doctor Joke', 'My child Mike, was playing doctor with his friend Jim. “I’m so sick” said my son, “Can you please take a look at me.” “Sure” said Jim taking out his toy stethoscope, after a few seconds of listening closely to his heart, he said sadly, “Oh Mike, you have a broken arm! ', 3.3, 61, 'http://www.greatcleanjokes.com/1428/playing-doctor/', 0),
(317, 'Kids Fears Joke', 'I live in Canada, a plane ride away from my family, so I was very excited to inform my twin 3 year olds that we were going to go on a plane to see my family. It was after a few days that it struck me that they seemed nervous about it. After talking it over with them I finally figured out the problem. They thought they would each have to fly on a separate plane by themselves. How else would we all fit into one of those tiny planes that fly in the sky?', 3.2, 66, 'http://www.greatcleanjokes.com/1416/kids-fears/', 0),
(318, 'What Do You Want To Be When You Grow Up?', 'I was a little surprised when my son suddenly announced one day after church, “I am thinking of being a Minister when I grow up.” “Why is that?” I asked. “Well, I figure I have to go to church on Sundays anyway, and I think it’ll be more fun to stand and yell then to just sit and listen.”', 3.7, 71, 'http://www.greatcleanjokes.com/1032/what-do-you-want-to-be-when-you-grow-up/', 3),
(319, 'Twin Joke', 'I couldn’t help laughing when one of my identical granddaughters tried insulting the other one, “well your ugly!”', 3.2, 15, 'http://www.greatcleanjokes.com/673/be-careful-what-you-say/', 0),
(320, 'Funny Therapist Video', NULL, 4, 45, 'http://www.greatcleanjokes.com/2805/funny-therapist-video/', 6),
(321, 'The Cheaper Solution', 'A lady went to a psychiatrist complaining of a terrible phobia. “Every time I lay down on my bed I get this terrible fear that there is something underneath. “Wow” responded the psychiatrist “I’ve never heard of such a phobia, but like all phobias it can be treated, but it will likely take around 20 sessions.” “OK” responded the lady “how much is each session?” “Oh it’s just $80 a session, but trust me it’s well worth it.” When the lady didn’t come back to the  psychiatrist  he gave the lady a call. “How come I didn’t hear from you? He asked.” “Well” responded the lady “when I came home and told my husband about the cost he thought he would save some money, ', 3.4, 88, 'http://www.greatcleanjokes.com/1273/the-cheaper-solution/', 4),
(322, 'Speeding Ticket Joke', 'So there was this female business executive who was late for a meeting.', 4.2, 95, 'http://www.greatcleanjokes.com/3144/speeding-ticket-joke/', 0),
(323, 'Late Joke', 'I was upset but not too surprised when I saw flashing lights in my rearview mirror. “I’m terribly sorry officer” I said “I was just trying to make it to a meeting on time.” “That’s a shame” the officer said upon handing me my ticket, “what time is the meeting called for?” “Three o’clock” I said. The officer looked at his watch, ', 2.6, 90, 'http://www.greatcleanjokes.com/2285/2285/', 0),
(324, 'Which Game?', 'It was at a miniature golf course on a brutally hot day when I saw a father with 3 kids. “Who’s winning?” I asked cheerfully. “I am” said one “no, I am” said another. “No,” the father said “', 3.3, 20, 'http://www.greatcleanjokes.com/1210/which-game/', 0),
