(328, 'Girl Friend Joke', '“Brian, what’s wrong with you? You’ve been sitting at your desk looking depressed for the last five minutes!” “Oh Dan,” responded Brian “I don’t know what to do! I got in a big fight last night with my Suzie, she claims I never buy her gifts, so I must not care about her!”', 4.1, 56, 'http://www.greatcleanjokes.com/3486/girl-friend-joke/', 0),
