(333, 'A Husband Is Like A Bar Of Soap', 'In an effort to make our site more interactive we ask people to please add a line in the comment space. The top ten additions will be posted as part of the joke, the rest will be kept as comments. Enjoy!', 2.9, 25, 'http://www.greatcleanjokes.com/2807/comparing-husband-joke/', 11),
(334, 'Death Preparation Joke', 'Barry and Hannah, an old married couple,  are sitting on the couch watching TV. On the show they were speaking about how to prepare in case of death etc. “Honey,” says Barry, turning to his wife with a serious expression, “I want you to promise me, that if there ever comes a time that I am dependent on just machines and bottled fluid, that you will make sure to  put an end to it.” “No problem hun,” said Hannah, and she promptly got up, turned off the TV, and poured his beer down the drain.', 3.8, 98, 'http://www.greatcleanjokes.com/2761/death-preparation-joke/', 6),
(335, 'Flower Joke', 'Harry and Barbra’s marriage has been on the rocks for a while, so when they hear about a marriage seminar being given in their neighborhood they decide to attend. “One of the most important things in marriage”, said the speaker, “is to get to really know your spouse well. For example,” continued the speaker, “How many of you know what’s your wife’s favorite type of flower?” Harry leaned over to Barbara and whispered, “it’s gold medal all-purpose flour isn’t it?”', 3.8, 47, 'http://www.greatcleanjokes.com/2737/flower-joke/', 2),
(336, 'Bye Bye Joke', 'My husband said it was him or the cat…I miss him sometimes.', 4, 24, 'http://www.greatcleanjokes.com/2395/bye-bye-joke/', 0),
(337, 'Marriage Sports', 'A newly married couple went fishing on their vacation. Afterwards the wife’s mother asked her how it went. “Oh, it was terrible, everything went wrong, we overslept, and then we got a flat tire, and the worst part was', 2.6, 61, 'http://www.greatcleanjokes.com/1343/marriage-sports/', 0),
(338, 'The Real Secret To A Happy Marriage', 'Jerry was at a marriage seminar, and the leader of the seminar, a lady, was asking everybody how long they were married for. When it was Jerry’s turn Jerry said that he was married for almost 50 years. “Wow”  the leader gushed “that’s amazing, perhaps you can take a few minutes to share some insights with everybody, how you stay married to the same woman for so long. “Well,” Jerry said after thinking for a few moments, “I try to treat her nice, buy her presents, take her on trips…………. and best of all, for our 25th anniversary I took her to the Bahamas.” “Well that’s really beautiful, and a true inspiration for all of us” the lady said “maybe you can tell us what you are going to do for your 50th anniversary” she said with a smile “Well” Jerry said “I’m thinking of going back to the Bahamas to pick her up.”', 4.1, 212, 'http://www.greatcleanjokes.com/885/the-real-secret-to-a-happy-marriage/', 3),
(339, 'Men Never Listen', 'My wife says I never listen to her………………………….or something like that.', 3.8, 14, 'http://www.greatcleanjokes.com/89/marraige-humor/', 0),
(340, 'Be Careful Who You Marry', 'When I married ', 3.7, 9, 'http://www.greatcleanjokes.com/68/marrige-humor/', 0),
(341, 'Men? Romance?', 'After I waited patiently while my husband played a round of golf on our 18th wedding anniversary he and I went out to dinner at a lovely restaurant. We discussed many happy memories we’ve shared during the years. Then I said “Want to go for another 18?” “no” he  replied “I think it’s too dark now.” -Mary Leach', 4, 21, 'http://www.greatcleanjokes.com/55/marriage-humor/', 0),
(342, 'Wife Insult Joke', '“Harry,” whined Mary, to her husband of 20 years. “What should I do?! I’m not ready for old age! I’m only 40 years old but I look and feel like I’m over 55! My face is all wrinkly, my back is bent over, and my hair is all thinned out.”', 4.1, 55, 'http://www.greatcleanjokes.com/3580/wife-insult-joke/', 0),
(343, 'Gambling Joke', 'John Sam and Abe, 3 retired friends,would get together every night, rain or shine, to play poker. It was a nice way to pass the time and the men enjoyed it immensely.', 3.8, 41, 'http://www.greatcleanjokes.com/3531/gambling-joke/', 0),
(344, 'Marital Bliss Joke', '“So Grandpa” asked Dave at his engagement party “your marriage to Grandma is legendary everyone talks about how you two get along so well and never fight, what’s the secret to your marital success?”', 4.2, 27, 'http://www.greatcleanjokes.com/3256/marital-bliss-joke/', 0),
