(346, 'Differences between Men and Women', '• Women have more imagination than men. They need it to tell men how wonderful they are.', 4.3, 36, 'http://www.greatcleanjokes.com/3146/differences-between-men-and-women/', 0),
(347, 'Wife Stress Joke', 'Harry had been feeling sick lately and was finally convinced to see the Doctor after his wife Suzy’s urging. After a thorough examination, and much thought, the Doctor was ready to tell Harry and a very worried Suzy, his prognosis. Harry was too stressed out. He would need 6 months of pure relaxation. Suzy, very agitated, took out her notepad to begin writing down his list of orders for these months of relaxation. “How should I go about it?” asked Harry. “OK” said the doctor “I would like your wife to take one tranquilizer four times a day…”', 3.6, 23, 'http://www.greatcleanjokes.com/3116/wife-stress-joke/', 0),
(348, 'Jealous Wife Joke', 'Standing in front of a boutique I noticed an impatient looking young man approach an attractive woman “would you mind talking to me for a few minutes?” he asked her “why?” she countered suspiciously.”my wife has been in this shop for a long time” the man explained “But I  ', 3.8, 128, 'http://www.greatcleanjokes.com/57/marriage-humor-2/', 1),
