(352, 'Adam and Eve Joke', 'Existence was so tranquil and peaceful for the young couple Adam and Eve, like straight out of a story book, until one unfortunate day when Adam showed up one hour late for supper.', 4.3, 19, 'http://www.greatcleanjokes.com/3982/adam-eve-joke/', 0),
