(354, 'Divorce Joke', 'Harry and his buddy Sam were going for a stroll. “Sam” said Harry “You know my wife?” “Sure do” said Sam. “Well she ain’t gonna be my wife anymore! Right after the weekend it’s gonna be over! I’m divorcing her!”', 3.4, 32, 'http://www.greatcleanjokes.com/3496/divorce-joke/', 0),
(355, 'The Happiest Day Joke', 'Harry was finally a  groom and was very excited about his upcoming marriage.  He was on his way out of the office when his boss came over to him with an outstretched hand, “congratulations Harry, I just wanted to tell you I’ve been married for twenty two years, and I am sure that you will always remember this day with the fondest of memories, as the happiest day of your life.” “But sir”, said Harry, “a little bit confused, I’m not getting married until tomorrow!”   “Yeah,  I know”, said his boss.', 3.5, 35, 'http://www.greatcleanjokes.com/2921/the-happiest-day-joke/', 0),
