(359, 'Who’s Wearing The Pants?', 'A man died and went up to heaven. Upon arriving he noticed two signs One said “Men Who Are Bossed By Their wives,” the other one said “Men Not Bossed By Their Wives.” After closer inspection he noticed that while next to the first sign was a big line, by the second sign there was just one man. After getting even closer he realized it was his friend Harry. “Hey Harry” the man questioned “what in the world are you doing here? Your wife bosses you around more then anybody.” “I don’t know” Harry replied “my wife told me to stand here.” ', 3.8, 71, 'http://www.greatcleanjokes.com/156/marriage-joke-2/', 1),
