(363, 'Girlfriend Joke', 'My girlfriend makes me want to be a better person…so that I can get a better girlfriend!', 2.9, 17, 'http://www.greatcleanjokes.com/3904/girlfriend-joke/', 0),
(364, 'Traveling Joke', 'So it was Jim’s first time leaving Europe, he was excited about visiting America and expanding his horizons. “Excuse me”, said a woman to him at the airport. “Do you happen to be traveling to America?” “As a matter of fact I am” responded Jim. “Do me a favor, my husband left to America 2 months ago and I haven’t seen or heard from him since. If you meet a fellow named John Dun, tell him to call his wife.” Jim happily complied and was on his way. He was barely in America for a hour when he saw a big building with the words Dun Watches, “Wow!” thought Jim “that was easy.” Jim walked into the building and asked the lady behind the desk “do you have a John here?” “Second door on the left,” was her reply. Jim saw a man walking out of the door drying his hands “are you Dun?” he asked. “Yes” came the mystified reply. “Call your wife,” said Jim, “she’s been waiting to hear from you.”', 3.1, 36, 'http://www.greatcleanjokes.com/2902/traveling-joke/', 3),
(365, 'Money Joke', 'Like most women, Sandy loves going shopping, much to her husbands chagrin. “Here take a look at this”, says her husband Tom, shoving the credit card statement in front of her. “You spent $250 at Macy’s, $150 at Nordstrom, $122 at Lord and Taylor, and another $225 at JC Penny. How in the world do you expect me to pay for all of this?” “Well,” answers Sandy, taken aback, “I’ve been accused of many things before, but one thing I am certainly not is inquisitive!”    ', 2, 50, 'http://www.greatcleanjokes.com/2703/money-joke-2/', 0),
