(371, 'Jury Duty Joke', 'It was Sally’s first time going for jury duty and she was a little bit apprehensive. “I would just like you to know” said Sally as soon as she was in front of the judge “that I feel very strongly that capital punishment is morally unjust and incorrect.” “That’s OK , said the judge “capital punishment is not a possibility in this case so it’s perfectly fine for you to serve on this jury.” “What’s the case about?” Asked Sally. “Well Mrs. Smith is filing a suit against her husband for gambling away the money she had saved for remodeling her bathroom”, replied the judge. “Alright” replied Sally “I’ll serve on this one, I may have been wrong about the capital punishment thing after all.”', 3.3, 32, 'http://www.greatcleanjokes.com/2972/jury-duty-joke/', 0),
(372, 'Marriage Truths', 'Marriage is a relationship were one person is always right…………and the other is the husband.           -Arnold', 3.9, 43, 'http://www.greatcleanjokes.com/1897/marrige-truths/', 0),
