(389, 'Vice President Joke', 'In the year 2000 Joe Lieberman ran for president, being that he was the first potential Jew in high office he was given a lot of attention. After a disappointing loss Joe walked into his house. “Don’t worry” said his wife “', 2.6, 145, 'http://www.greatcleanjokes.com/1432/1432/', 0),
(390, 'Birth Control Joke', '“Alright! I’ll drive them to the field trip tomorrow!” Sighed my neighbor resignedly. Sure enough the next day found her with a van full of  7 to 10 year olds.', 2.6, 68, 'http://www.greatcleanjokes.com/3894/birth-control-joke/', 0),
(391, 'Landlord Joke', '“Sir you have got to help!” said the tearful man at the door. “There is a family that I know very well that is in desperate need of money. The Father has been out of a job for over a year, they have five kids at home with barely a bit of food to eat. The worst part is, that they are about to kicked out of the house and they will be left on the streets without a roof over their heads!” The man concluded with one last heart wrenching sob.  ', 3, 135, 'http://www.greatcleanjokes.com/3582/landlord-joke/', 1),
(392, 'Peep Joke', 'I couldn’t stop myself from laughing last night as I was putting my 2 year old and 4 year old into bed. “I’M CLOSING THE DOOR NOW AND I DON’T WANT TO HEAR A PEEP!” I hollered. I was about to close the door in a huff when I heard my two year old standing in his crib with a defiant look on his face saying “peep, peep, peep.”', 3, 68, 'http://www.greatcleanjokes.com/3128/peep-joke/', 0),
(393, 'Bitter Divorce Joke', 'It was a bitter divorce, after four years of marriage and two children it was over. Sam showed up in court together with his ex to see what the verdict would be. Finally after a long court case the verdict was decided. “Ok”, said the judge, turning to Sam, “I am rewarding your ex-wife Ann $470 dollars a month.” “That’s really kind of you, and I really appreciate it” said Sam “I’ll try to send her a little bit from time to time myself.”', 3, 68, 'http://www.greatcleanjokes.com/2874/bitter-divorce-joke/', 2),
(394, 'LOL Joke', 'John angrily looked at the text he had just received from his Mom.  It read: “Professor called to say you failed the course.  LOL.  Mom. ”  How could he have failed?! … And all his Mom has to say is that she’s Laughing Out Loud?!  Fed up, he text-ed his Mom: “What was up with the LOL?”  his text said.   “I just wanted to send you Lot’s Of Love because I know how disappointed you must be.”', 3.1, 147, 'http://www.greatcleanjokes.com/2789/lol-joke/', 7),
(395, 'Grandmother Joke', 'It was Timmy’s 5th birthday and he was joyfully opening all the presents he received. He saved the biggest for last, so it took a while until he got to opening Grandma’s present. “Wow” Timmy exclaimed in delight, upon seeing the mini drum set that his Grandmother got for him. “Thanks Grandma this is just what I wanted.” It was after Timmy went to bed that Timmy’s mother approached her mother. “Ma, I’m surprised at you, don’t you remember how it used to drive you crazy when we used to play the drums in the house growing up?” Grandma smiled and then said “I remember, of course I remember.” ', 3.4, 125, 'http://www.greatcleanjokes.com/2723/grandmother-joke/', 2),
(396, 'Hearing Aid Joke', 'While working in a post office, a lady barged in complaining that she got home to find a note from the mail man saying that he tried to deliver a package but nobody was home. “My husband was home all day!”, she fumed. After giving her the package I heard her tell somebody “Oh, I’m so excited, my husbands new hearing aids!”', 2.6, 52, 'http://www.greatcleanjokes.com/2675/hearing-aid-joke/', 0),
(397, 'Getting Old Joke', 'Recently divorced, I moved back to my home town hoping to start over again. A few weeks later, while making a dentist appointment, I was surprised to see I recognized the dentist’s name as a good looking boy from my high school 20 years ago. However, upon walking into the dentist’s office, I quickly realized he must be someone else.  He was bald, had a big beer belly, and looked a lot older than me. Just to be sure though, on my way out I asked him if he went to the high school that I had attended. “Yeah”, he responded, “I graduated in 91.” “Oh my gosh”, I excitedly said “you were in my class.” “Really”, he said that’s interesting, “what class did you teach?”', 3.8, 65, 'http://www.greatcleanjokes.com/2670/getting-old-joke/', 0),
(398, 'Adoption Joke', 'A woman has twins and gives them up for adoption.', 2.4, 380, 'http://www.greatcleanjokes.com/2648/adoption-joke/', 11),
(399, 'Porshe Joke', 'Anxious to finally get the porch painted, I urged by husband to allow the man that knocked on our door looking for handiwork to do the job. The man happily agreed to paint it for $50. We were thrilled at our good luck of getting our wide porch painted for a measly $50. Minutes later there was a knock at the door. “All done” he said. “Already?” we both said at once. “Yeah, and by the way, it’s a lexus not a porsche”.', 3.7, 29, 'http://www.greatcleanjokes.com/2305/porshe-joke/', 0),
(400, 'Immigrant Joke', 'An immigrant from Poland who was married to an American barged into the police station out of breath. “My wife, she try to kill me” he stammered. “Are you absolutely sure?” questioned the police officer. “Of course I sure” he countered insulted “you think I dumb, look what I found in her purse” he said pulling a bottle out of his pocket, “look it says', 3.2, 69, 'http://www.greatcleanjokes.com/1450/1450/', 1),
(401, 'Dirty Restaurant Joke', 'A couple walked into a cheap looking restaurant. As they were about to sit down they noticed there were crumbs on the seat, after cleaning up the seat and wiping down the table they sat down. A waitress came over asking them what they wanted, “I’ll just take a coffee” said the man, “me too” said the lady “and make sure the cup is clean.” The waitress returned with their drinks “OK” she said placing down their cups ', 3.3, 50, 'http://www.greatcleanjokes.com/1134/clean-freaks/', 0),
(402, 'How To Get Rid Of Junk', 'My husband was trying to get rid of a perfectly good couch, but despite it being outside for over a week with a sign that said “FREE” nobody was taking it. Then my teenage son thought of a plan, he put a sign “$50″ on it, it was gone the next day!    ', 3.6, 14, 'http://www.greatcleanjokes.com/822/how-to-get-rid-of-junk/', 0),
(403, 'Funny Names', 'My husband’s name is Bud and my name is Beth. For our 20th anniversary my son got us a name plate for our house it said “Bud Beth and Beyond”', 3.5, 25, 'http://www.greatcleanjokes.com/622/funny-names/', 0),
(404, 'Manly Men Joke', 'My husband was trying to be nonchalant before a speech he was about to give. “Are you nervous” I asked “Nah” he said with a yawn “piece of tea, piece of tea.”', 2.5, 27, 'http://www.greatcleanjokes.com/473/manly-men-men-jokes/', 0);
INSERT INTO `jokes` (`id`, `title`, `content`, `rating`, `votes`, `url`, `comments_count`) VALUES
(405, 'Outhouse Joke', 'A man gathered all of his children together and said “Children when George Washington knocked down the cherry tree, he told his father honestly that it was him , now answer me honestly, Who knocked down the outhouse? Finally the youngest son admitted it was him, at which he received a lashing he wouldn’t soon forget. “Thats not fair” complained the son, “George Washington didn’t get punished when he told the truth.”', 4.2, 34, 'http://www.greatcleanjokes.com/201/outhouse-humor/', 0),
(406, 'Amish Joke', 'An Amish girl and her mother were visiting a mall. They were amazed by almost everything they saw, but especially by two shiny, silver walls that could move apart and back together again. The girl asked, “Mother, what is this?”', 4.1, 57, 'http://www.greatcleanjokes.com/287/amish-joke/', 1),
(407, 'The Blind Man Joke', 'A blind man  walks into a store with a seeing eye dog. Much to the store owners surprise the blind man picks up the dog by it’s tail and starts swinging it around over his head. Puzzled, and a bit upset the store owner walks over to the man and says, ', 3.8, 52, 'http://www.greatcleanjokes.com/171/funny-story-6/', 1),
(408, 'The Tricky Wife Joke', 'A lady was walking down the street when she was a approached by a lady beggar asking for money. The lady took a $20 bill out of her purse, and asked “if I give you this money will you spend it on chocolate.” “Don’t be ridiculous” the beggar replied “does it look like I have nothing better to spend money on?” “How about shopping?” she asked. “No,” the beggar said, “don’t you understand I need money just to stay alive.” “Will you spend it on your hair?” the lady asked. Annoyed the beggar replied, “', 4.1, 205, 'http://www.greatcleanjokes.com/164/funny-story-5/', 5),
(409, 'Get A Raise Joke', 'One day an employee sends a letter  to his boss to increase his salary!!!', 4.2, 224, 'http://www.greatcleanjokes.com/80/funny-story-3/', 4),
(410, 'One Letter Makes A Big Difference', 'An Illinois man  left the snow-filled streets of Chicago for a vacation in Florida. His wife was on a business trip and was planning to meet him there the next day. When he reached his hotel he decided to send his wife a quick email. Unfortunately, when typing her address, he missed one letter, and his note was directed instead to an elderly preacher’s wife whose husband had passed away only the day before. When the grieving widow checked her email, she took one look at the monitor, let out a piercing scream, and fell to the floor in a dead faint.At the sound, her family rushed into the room and saw this note on the screen: Dearest Wife,', 4.2, 724, 'http://www.greatcleanjokes.com/78/funny-story-2/', 14),
(411, 'Lisp Joke', 'Ever Wonder? Whose cruel idea was it for the word “Lisp” to have a “S” in it? ', 3.9, 28, 'http://www.greatcleanjokes.com/1999/lisp-joke/', 0),
(412, 'Civil War Joke', 'Ever Wonder? How is it possible to have a civil war? ', 2.8, 14, 'http://www.greatcleanjokes.com/1992/civil-war-joke/', 0),
(413, 'Pencil Thought', 'Ever Wonder? If the #2 pencil is the most popular, why is it still #2? ', 4, 30, 'http://www.greatcleanjokes.com/1990/pencil-thought/', 0),
(414, 'Gardener Joke', 'Ever Wonder? What do gardeners do after they retire?', 2.7, 24, 'http://www.greatcleanjokes.com/1752/gardener-joke/', 0),
(415, 'Lemon Thought', 'Ever Wonder? Why is lemon juice made with artificial flavor, and dishwashing soap made with real lemons?', 3.9, 27, 'http://www.greatcleanjokes.com/1641/lemon-thought/', 0),
(416, 'Abbriviated Thought', 'Ever Wonder? Why is “abbreviated” such a long word?', 3.5, 10, 'http://www.greatcleanjokes.com/1638/abbriviated-thought/', 0),
(417, 'Doctor Thought', 'Ever Wonder? Why is it that doctors call what they do “practice”?', 3.6, 33, 'http://www.greatcleanjokes.com/1636/doctor-thought/', 0),
(418, 'Mascara Thought', 'Ever Wonder? Why can’t women put on mascara with their mouth closed?', 3.3, 18, 'http://www.greatcleanjokes.com/1634/mascara-thought/', 0),
(419, 'Ball Game Thoughts', 'Ever Wonder? Why do we sing ‘Take me out to the ball game’, when we are already there?', 2.8, 8, 'http://www.greatcleanjokes.com/1479/ball-game-thoughts/', 0),
(420, 'Body Thoughts', 'Ever Wonder? Why does your nose run and your feet smell?', 3.2, 11, 'http://www.greatcleanjokes.com/1477/body-thoughts/', 1),
(421, 'Fat Thought', 'Ever Wonder? Why do fat chance and slim chance mean the same thing? ', 3.3, 11, 'http://www.greatcleanjokes.com/1475/fat-thought/', 0),
(422, 'Cheese Thought', 'The early bird may get the worm, but the second mouse gets the cheese.', 4.1, 23, 'http://www.greatcleanjokes.com/1459/cheese-thought/', 0),
(423, 'Pizza Musings', 'Ever Wonder? Why does round pizza come in a square box?', 2.6, 15, 'http://www.greatcleanjokes.com/1426/pizza-musings/', 0),
(424, 'Thoughts About Money', 'Ever wonder? If you have to put two cents in, but it’s only a penny for your thoughts, ', 2.8, 10, 'http://www.greatcleanjokes.com/1424/thoughts-about-thoughts/', 0),
(425, 'Salami Thoughts', 'If bread is square why is sandwich meat round?', 2.5, 8, 'http://www.greatcleanjokes.com/1422/salami-thoughts/', 0),
