(437, 'Anti-Semitism Joke', 'After recess the first grade teacher announced “I am going to go around the room and ask you what you did during recess, if you can write what you did on the board you’ll get a lollipop.” The first girl asked was Jessica “Jessica what did you do during recess?” “I played in the sand box.” “OK” the teacher said “let me see you write the word ‘box’ on the board.” She did and got a lollipop.', 2.4, 257, 'http://www.greatcleanjokes.com/1713/anti-semitism-joke/', 1),
(438, 'Blind Man Joke', 'Two men, Jim and John, were walking their dogs when they passed by a restaurant. “Let’s go in and get something to eat,” Jim suggested. “We can’t” responded John, “don’t you see the sign says NO PETS ALLOWED.” ', 4.1, 363, 'http://www.greatcleanjokes.com/1683/blind-man-joke/', 7),
(439, 'Millionaire Joke', 'A fellow walked into a bank in New York City asking for a loan for $4000 dollars. “Well, before we lend you the money we are going to need some kind of security” the bank teller said. “No problem” the man responded here are the keys to my car “you’ll see it, it’s a black Porsche parked in the back of the parking lot.”', 3.7, 237, 'http://www.greatcleanjokes.com/1681/millionaire-joke/', 5),
(440, 'Who Is The Real Boss?', 'The Boss of our small company was complaining during a staff meeting that people didn’t respect him enough. Trying to change the attitude in the office he came in the next day with a sign for his  door it said, “I am the boss”. ', 3.9, 137, 'http://www.greatcleanjokes.com/1607/who-is-the-real-boss/', 4),
(441, 'College? Study?', 'After sending our son away to college, he would often [to often] call up asking for money. One time when he called my husband answered, “sure we will send you money” he said, “and I also noticed that you left your Physics book here, should we send that also?” “Uh, oh yeah, OK,”  he responded. I asked him afterward how much he sent up “$1,100″ he said. When I gave him a surprised look, he explained, “Don’t worry, I taped a $100 check on the cover, ', 2.3, 159, 'http://www.greatcleanjokes.com/1604/college-study/', 3),
(442, 'The Honest Lawyer?', 'The city miser was on his death bed, as his last request he asked to be alone with his lawyer, doctor, and priest. “I know I am going to die” he said ” and I would like to take my money with me, so I am going to give each of you $150,000 and I want you to each make sure the money gets in the coffin.” ', 3.9, 117, 'http://www.greatcleanjokes.com/1414/the-honest-lawyer/', 0),
(443, 'The Addicted Golf Player', 'Two guys were playing golf, one of them was about to swing the golf club when he noticed a funeral procession going by on the street. The man stopped in mid-swing and closed his eyes and said a short prayer. The other man truly inspired, remarked, clearing his throat, “wow that was one of the most beautiful things I have ever seen.” “Well”, the other man said “I was married to her for 35 years.”', 4, 63, 'http://www.greatcleanjokes.com/1337/tha-addicted-golf-player/', 0),
(444, 'One Way To Save Money', 'A man named Marty called his son. “Harry I have news to tell you, I know it’s going to upset you but I have made up my mind and there is nothing you can do about it. I have decided to divorce your mother.” “But dad how can that be “the son asked “you have been married for 40 years, and you always seemed to get along? What happened suddenly?” “Son, I have made up my mind, and I don’t want you to try to convince me out of it.” “OK” the son responded “but promise me you won’t do anything until I come and talk to you in person, and I am going to ask all of the siblings to fly in also.”Alright” said the father hanging up “you have my word. “Well” said Marty, turning to his wife “I got them all to come in ', 3.9, 93, 'http://www.greatcleanjokes.com/1330/one-way-to-save-money/', 0),
(445, 'Lord Or No Lord?', 'A religious women upon waking up each morning would open her front door stand on the porch and scream, “Praise the lord.” This infuriated her atheist neighbor who would always make sure to counter back, “there is no Lord.” One morning the atheist neighbor overheard his neighbor praying for food, thinking it would be funny, he went and bought her all sorts of groceries and left them on her porch. The next morning the lady screamed, “praise the Lord, who gave me this food.” The neighbor laughing so hard he could barely get the words out screamed “it wasn’t the Lord, it was me.” The lady without missing a beat screamed “', 4.3, 194, 'http://www.greatcleanjokes.com/1106/lord-or-no-lord/', 6),
(446, 'The Annoying Duck Joke', 'A duck walks into a bar, and asks the bartender, “do you have any grapes?” “Nope” responded the bartender, “try somewhere else.” The duck walks out and back in, “do you sell grapes?” “I told you already I don’t” responded the bartender, “stop bothering me.” The duck walks back out and then back in again, “stop right where you are”  the bartender screams “you ask me again if I have grapes I will take a hammer and nail your feet to the floor.” The duck walks out  and then back in again, “do you sell nails?” he asks “No” responded the bartender.” “', 3.2, 144, 'http://www.greatcleanjokes.com/1085/the-annoying-duck/', 0),
(447, 'It’s Never Too Late', 'Two oldies got engaged, and as they were strolling down the street excitedly planning there wedding they passed a drugstore. “Excuse me” the man said to the clerk, “Do you sell medicine for memory problems?” “Sure” replied the clerk “all kinds.” “How about for arthritis?” “Yup” replied the clerk. “Wheelchairs, walkers, adult diapers?” “Yeah”, replied the clerk, all kinds. “OK excellent” said the man “because we are getting married next month,', 3.5, 36, 'http://www.greatcleanjokes.com/898/its-never-too-late/', 0),
(448, 'Men? Fathers?', 'A couple had their first baby. After a week or so the mother thought she could use a break and went shopping leaving the little baby with the proud father. It was only a short while before the baby started to cry. The perplexed father tried all of the tricks that he remembered his wife doing but to no avail. Finally after a half hour  in desperation he went to the doctor. After checking all of the regular things the doctor  discovered it was just a dirty diaper.', 4.3, 19, 'http://www.greatcleanjokes.com/539/men-fathers-men-joke/', 1),
(449, 'The Real Mother-In-Law', 'Once two ladies came before King Solomon, fighting over a boy. “He’s my son-in law” one said “No he’s mine” countered the other. After thinking for a few minutes the King finally decided on a ruling. “Bring me my sword and we will cut the boy in half, they will each get half.” “No” the first lady screamed “don’t cut him in half I would rather the second lady get the whole son-in-law.” Ah Hah said King Solomon with a big smile I now know who is the real mother-in-law. ', 3.6, 54, 'http://www.greatcleanjokes.com/530/the-real-mother-in-law-mother-in-law-joke/', 0),
(450, 'Teachers Gotta Be Smart', 'There were four teenagers who played hooky one morning. Upon coming to class in the afternoon, they reported that their lateness was because their car got a flat tire. That’s fine the teacher said much to the students relief. But there was an oral test this morning which you boys have to make up, so please have a seat and take out a piece of paper. “Now for the first question, ', 3.4, 85, 'http://www.greatcleanjokes.com/437/teachers-gotta-be-smart-clever-jokes/', 0),
(451, 'Stop Complaining!!!', 'A young Catholic priest decided to enter a monastery. He joined one particularly strict sect. The head monk told him, at his indoctrination, that they were sworn to TOTAL silence. They could not speak one word at all. However, every ten years, they would be permitted to speak two words.After 10 years of total silence, the head monk indicated it was now time for him to speak his two words. The monk said, “Bed hard!” And then he resumed his silent study and work.Another 10 years passed and the head monk again indicated it was time for him to speak his two words. The monk said, “Food bad!” And then he resumed his silent study and work.Another 10 years passed and the head monk again indicated it was time for him to speak his two words. The monk said, “I quit!”The head monk shook his head and said, “I knew this was coming. You’ve done nothing but complain for the past 30 years!”', 4.1, 54, 'http://www.greatcleanjokes.com/274/religous-joke-2/', 3),
(452, 'The Continued Battle Of The Sexes', 'All of the relatives gathered together in the hospital waiting room tensely waiting the Doctors report. Finally after what seemed like hours the Doctor finally came out. “Well” he said “I have good news and bad news. The bad news is I am afraid his brain doesn’t work anymore, but the good news is that there is a new procedure called a brain transplant. But I am afraid it’s quite expensive and it’s not covered by insurance. After a few seconds one of the sons asked “well how much does it cost.” The Doctor replied “it’s $10,000 for a male brain and $2,000 for a female brain.” The moment turned quite awkward and despite the seriousness of the situation some of the men actually started smiling. Finally one of the men couldn’t control himself and asked the question everyone wanted to ask. “Why is the female brain so much less.” “Oh that’s just standard pricing procedure,”the Doctor replied “you see we have to charge less for the female brain simply because they’re used.   ', 4, 48, 'http://www.greatcleanjokes.com/263/men-joke/', 2),
(453, 'Lawyers Lie Joke', 'A young lawyer died and was brought to heaven. Upon arriving the lawyer started protesting that it’s way to early for him to day, for he was only 32 years old, and there must be some mistake. The listening angel agreed that perhaps it was a mistake and agreed to look into it. After a few minutes the angel came back and said  “I’m sorry sir but I am afraid there is no mistake, we calculated your age by how many hours you billed your clients, and you are at least 96.   ', 4.2, 52, 'http://www.greatcleanjokes.com/250/lawyer-joke-4/', 0),
(454, 'Good Church Excuse', 'A friend of mine was in front of me coming out of church one day, and the vicar was standing at the door, as  always , to shake hands with the worshipers. He grabbed my friend by the hand and pulled him aside. The vicar said to him, “You need to join the army of the Lord.” My friend replied, “I’m already in the army of the Lord, Father.”So the vicar inquired, “Then how come I only see you  at Christmas and at Easter?”', 4, 66, 'http://www.greatcleanjokes.com/94/religous-joke/', 1),
(455, 'The Bathroom Joke', 'Three engineers and three accountants are traveling       by train to a conference.At the station, the three accountants each  buy       tickets and watch as the three engineers buy only a single ticket.”How are three people going to travel on only       one ticket?” asks an accountant.”Watch and you’ll see,” answers an       engineer. All of them board the train.The accountants take their respective seats  but all       three engineers cram into a restroom and close the door behind  them.Shortly after the train has departed, the  conductor       comes around collecting tickets. He knocks on the restroom door  and says,       “Ticket, please.”The door opens just a crack and a single arm  emerges       with a ticket in hand. The conductor takes it and moves on.The accountants saw this and agreed it was  a       clever idea.So after the conference, the accountants  decide to       copy the engineers on the return trip and save some money .When they get to the station they buy a  single ticket       for the return trip.To their astonishment, the engineers don’t  buy a       ticket at all.”How are you going to travel without a       ticket?” says one perplexed accountant.”Watch and you’ll see,” answers an       engineer.When they board the train the three  accountants cram       into a restroom and the three engineers cram into another one  nearby. The       train departs.Shortly afterward, one of the engineers  leaves his       restroom and walks over to the restroom where the accountants are  hiding.He knocks on the door and says, “Ticket,       please.”', 4.2, 448, 'http://www.greatcleanjokes.com/31/long-joke/', 10),
(456, 'River Joke', 'Two Blondes are on opposite sides of the river, “How do I get to the other side?” hollered one blonde. “You are on the other side,” the other one hollered back.', 3.8, 75, 'http://www.greatcleanjokes.com/2773/river-joke/', 1),
(457, 'Librarian Joke', 'Librarian – “Yes, how can I help you?', 2, 130, 'http://www.greatcleanjokes.com/2468/librarian-joke/', 1),
(458, 'Parking Fine Joke', '“I got a compliment on my driving today,” said a blonde to her friend, there was a note left on my windshield it said “parking fine”.', 4.1, 101, 'http://www.greatcleanjokes.com/2462/parking-fine-joke/', 1),
(459, 'Fax Joke', '“Can you please fax over your resume?” asked the interviewer. “I’m sorry” responded the blonde, “it’s my only copy!” ', 3.1, 33, 'http://www.greatcleanjokes.com/2377/fax-joke/', 1),
(460, 'Shoe Joke', 'A blonde walks into a shoe store to try on a pair of shoes. After trying on a pair she complained that they were a bit tight. “Try pulling the tongue out,” suggests the sales clerk. “Nath theyth sthill feelth a bith tighth,” responds the blonde.', 3.7, 99, 'http://www.greatcleanjokes.com/2346/shoe-joke/', 1),
(461, 'Dumb Blonde Joke', '“Can you check if my rear blinker works?” hollered the brunette to the blonde pedestrian walking by. “Sure,” responded the blonde, heading to the back of the car. “Ok,” said the brunette pushing the switch, “is it working?”   “Yes, no, yes, no…”', 3.6, 131, 'http://www.greatcleanjokes.com/2310/dumb-blonde-joke/', 2),
(462, 'Puzzle Joke', 'A brunette walked into a room and saw her blonde friend whooping and hollering. ', 4.2, 113, 'http://www.greatcleanjokes.com/2081/puzzle-joke/', 2),
(463, 'Blonde In A Tree Joke', 'Q. How do you get a blonde out of a tree?', 2.5, 38, 'http://www.greatcleanjokes.com/1709/blonde-in-a-tree-joke/', 0),
(464, 'This Side Up Joke', 'A foreman of a factory was making his rounds inspecting how all of the workers were doing their jobs. “Well” he said to one blond worker, “I see you are doing a very diligent job stamping all of the boxes ‘THIS SIDE UP’. “Yes” the worker replied, eager to please, “and just to be extra sure I stamped the bottom also!”   ', 3.7, 39, 'http://www.greatcleanjokes.com/1533/this-side-up-joke/', 0),
(465, 'Animal Cracker Joke', '“Mom, can I have an animal cracker?” asked 3 year old Bob. “Sure Bob,” said his mom. “Open up the box, and take a few.” ', 4, 46, 'http://www.greatcleanjokes.com/3396/animal-cracker-joke/', 1),
(466, 'Door Bell Joke', 'Everyone loved Priest John. He was a happy jolly fellow always willing to help or lend a hand. One time John was walking down the street humming a tune when he saw a little boy trying to reach the doorbell of a nearby house.  “Hey there sonny” said John “let me help you out”, and with that  John reached out and pressed the bell. “Anything else I can do for you,” asked John with a smile. “Yes” said the boy. “Run! We’ve only got a few seconds before they come!”', 3.7, 31, 'http://www.greatcleanjokes.com/2966/2966/', 0),
(467, 'Boxing Joke', 'Trying to be a good dad and spend some time with my son, I used to pretend we were boxing. I would get into a fighter stance and jab with both of my fists saying one-two one-two. That all came to a rather abrupt end, when one day his teacher was handing something out to his class, and asked my son, “would you like one too?”', 2.5, 22, 'http://www.greatcleanjokes.com/2507/boxing-joke/', 0),
(468, 'Tooth Fairy Joke', '“Are you the tooth fairy?” my seven year old asked, after yet another tooth fell out. Very impressed that she picked up on this, I assured her that I am in fact the tooth fairy. My bubble was burst a few minutes later, when after thinking for a few seconds she asked, “how do you get into the other kids houses?”', 3.1, 52, 'http://www.greatcleanjokes.com/2448/tooth-fairy-joke/', 0),
(469, 'Seal Joke', 'I was eagerly drinking in the attention in my grandson’s second grade class telling them what it was like to be a Navy Seal. My bubble was soon burst when I asked if their are any questions. “So” questioned one girl, “can you balance a ball on your nose?”', 3.7, 26, 'http://www.greatcleanjokes.com/2433/seal-joke/', 0),
