(481, 'Smart Mother In Law Joke', 'So David Is finally engaged, and is excited to show off his new bride. “Ma”, he said to his Mother, “I’m going to bring home three girls and I want you to guess which one is my fiance.” Sure enough twenty minutes later, David  walks in the door with three girls following behind him. “It’s that one”, said his mother, without blinking an eye.  ”Holy cow”, exclaimed David, “how in the world did you know it was her?” “I just don’t like her”, she replied.', 3.1, 33, 'http://www.greatcleanjokes.com/2750/smart-mother-in-law-joke/', 1),
