(499, 'Absent From Church Joke', 'Harry walked over to the Priest after services, “You know Father, I am really stuck in a quandary I would like to attend church next week but I just can’t miss the big game next Sunday, it’s just out of the question.” “Oh Harry Harry” said the Priest putting his arm around Harry, “don’t you know? that’s what recorders are for.” Harry’s face lit up “you mean I could record your sermon?”', 3.3, 43, 'http://www.greatcleanjokes.com/3157/absent-from-church-joke/', 0),
