(516, 'Too Old To Date Joke', 'The neighbors thought it was odd, but 93 year old Morton was dating again.  One Monday morning Morton woke up with a funny feeling that something important happened last night.  It was during breakfast, that Morton finally remembered what it was.  He had proposed to his date Greta. But what she answered he just couldn’t seem to remember.  Morton picked up the phone and dialed.  ”Hi Greta”, said Morton, “I have a funny question for you, do you remember last night when I proposed?”  ”Oh my gosh” gushed Greta, “I’m so glad you called, I knew I said yes to somebody but I just couldn’t recall who it was!”', 3.4, 47, 'http://www.greatcleanjokes.com/2928/too-old-to-date-joke/', 4),
(517, 'Exercise Joke', 'At the urging of Harry’s wife and doctor, 50 year old Harry finally made it to the gym. After consulting with one of the trainers, Harry decided to try out a steep treadmill. “Ok”, said the trainer “I’m going to set it for ten minutes, if you want to go longer just press start again.” At first Harry was doing fine but after 5 seconds he started getting tired, and after a minute he jumped off gasping for breath. Walking to the side to sit down, he passed by a friend of his. “Man”, said Harry. “I could barely last a full minute on that treadmill.” “Alright alright”, said his buddy, “no reason to brag!”', 3, 50, 'http://www.greatcleanjokes.com/2842/exercise-joke/', 0),
(518, 'Take Turns Joke', 'While working the lunch shift at a local restaurant, I watched as an elderly couple ate.  It seemed as if the man was the only one eating.  First his appetizer, then his main, and then finally his dessert.  All the while with his wife just looking on, not even touching her food.  Confused, I approached the woman and asked if there was anything I could get for her.  “No thank you,” came her answer, “it’s his turn for the teeth.”', 4.2, 35, 'http://www.greatcleanjokes.com/2783/take-turns-joke/', 2),
