(561, 'Finding A Job Joke', NULL, 3.1, 81, 'http://www.greatcleanjokes.com/3290/finding-a-job-joke/', 0),
(562, 'Money Or Your Life Joke', 'Two thugs walked into a Mexican bank and demanded that the teller hand over all she had.  “No comprendo” (I don’t understand) was her innocent response.  ', 2.5, 41, 'http://www.greatcleanjokes.com/3373/money-or-your-life-joke/', 0),
(563, 'War Joke', 'War does not determine who is right – only who is left.', 4, 103, 'http://www.greatcleanjokes.com/2231/war-joke/', 1),
(564, 'Advice Joke', 'Take my advice; I don’t use it anyway.', 3.4, 64, 'http://www.greatcleanjokes.com/2184/advice-joke/', 0),
(565, 'Politically Correct Joke', 'Nothing political is correct. ', 2.6, 33, 'http://www.greatcleanjokes.com/2177/politically-correct-joke/', 0),
(566, 'Political Joke', 'I don’t approve of political jokes…I’ve seen too many of them get elected. ', 4, 25, 'http://www.greatcleanjokes.com/2015/political-joke/', 0),
(567, 'Loyal Secretary Joke', 'Bernice had been employed at the same office for over 50 years and was the boss’s top secretary.  Everyone was jealous of her. Every day when Bernice showed up for work she would open the drawer to her left, peek inside, and then lock it. When she finally died, her coworker Sandy, who was dying of curiosity, made it her mission to figure out what was in that drawer.  ', 2.8, 46, 'http://www.greatcleanjokes.com/3091/loyal-secretary-joke/', 0),
(568, 'Raise Joke', 'Sam walks into his boss’s office. “Sir, I’ll be straight with you, I know the economy isn’t great, but I have over three companies after me, and I would like to  respectfully ask for a raise.” After a few minutes of haggling the boss finally agrees to a 5% raise, and Sam happily gets up to leave.  ', 4, 102, 'http://www.greatcleanjokes.com/2752/raise-joke/', 10),
(569, 'Parenting Joke', 'Today’s Parenting Tip: Treat a difficult child the way you would your boss at work. Praise his achievements, ignore his tantrums and resist the urge to sit him down and explain to him how his brain is not yet fully developed. ~Robert Brault', 3.9, 39, 'http://www.greatcleanjokes.com/2334/parenting-joke/', 2),
(570, 'Burglar Joke', 'Max was caught red handed by a police officer in the very act of burglarizing a store. He was quickly brought to trial.', 4.2, 30, 'http://www.greatcleanjokes.com/3177/burglar-joke/', 0),
(571, 'How A Lawyer Bills Joke', 'A doctor and a lawyer were both at a reception. The lawyer noticed that people were constantly coming over to the doctor. “Why are so many people coming over to you?” asked the lawyer. “It’s terrible,” sighed the doctor, “ever since I became a doctor I don’t have a moments peace, people are constantly coming over to me for medical advice.” “I’ll tell you what I do,” said the lawyer with a sneer , “I send them a bill in the mail.” The doctor agreed with the lawyer that this was a good solution. The next day upon mailing the bills he was surprised to see a letter from the lawyer, he was even more surprised when he opened it………….', 2.8, 62, 'http://www.greatcleanjokes.com/2254/sneeky-lawyer-joke/', 0);
INSERT INTO `jokes` (`id`, `title`, `content`, `rating`, `votes`, `url`, `comments_count`) VALUES
(572, 'An Honest What?', 'A little boy was in a cemetery with his mother “Mommy” the boy asked , “do they ever bury two people in the same grave?”', 4.2, 63, 'http://www.greatcleanjokes.com/2085/an-honest-what/', 0),
(573, 'Lawyer Quote', 'You have the right to remain silent. Anything you say will be misquoted, then used against you.', 3.5, 29, 'http://www.greatcleanjokes.com/1455/lawyer-quote/', 0),
(574, 'The Appeal', 'It was a Tuesday when the judge passed a verdict against a certain lawyers client. On Wednesday the lawyer rushed into the judges chambers. ” Your honor I just found out new information and I would like to file an appeal.” “What did you find out?”, asked the judge. After a few moments of silence the lawyer responded “well I found out my client has another $5000 dollars.', 4.1, 15, 'http://www.greatcleanjokes.com/1333/the-appeal/', 0),
(575, 'Who’s Worse?', 'A Drunk climbs on a bar stool in a bar and screams “All lawyers are sneaky thieves.” A man stands up and says “Hey, I resent that remark.”', 4.3, 28, 'http://www.greatcleanjokes.com/423/whose-worse/', 0),
(576, 'The Lying Test Joke', 'Q.How can you tell when a lawyer is lying?', 3.5, 20, 'http://www.greatcleanjokes.com/202/lawyer-joke/', 0),
(577, 'The Reason I’m Tired!', 'For a couple of years I’ve been blaming it on lack of sleep and too much pressure from my job, but now I found out the real reason: I’m tired because I’m overworked. ', 4.4, 126, 'http://www.greatcleanjokes.com/3508/the-reason-im-tired/', 2),
(578, 'Business Dinner Joke', 'The business I work for had a dinner together with all family members. Before the first speech, the emcee gave the following announcement, “we kindly ask if you can please put all cell phones and children on vibrate.”', 2.9, 34, 'http://www.greatcleanjokes.com/2684/business-dinner-joke/', 0),
(579, 'Good News Joke', 'Sam and Thomas had been business partners for the past 50 years.  They were in the wholesale clothing business and lately business was not as glorious as it had been. They had recently bought 400 polka dot dresses and no one seemed the slightest bit interested in them.', 2.6, 29, 'http://www.greatcleanjokes.com/3388/good-news-joke/', 0),
(580, 'Interview Joke', 'Always self conscious of his lack of ears, whenever Bob would interview a future employee, he would as him “what do you notice different about me?”.  If the employee would mention his lack of ears (which often they did), it would be a for sure “no” for the job.  However if the employee would mention something else, he would hire the guy.  ', 4.2, 25, 'http://www.greatcleanjokes.com/3386/interview-joke/', 0),
(581, 'Ethics Joke', '“So, Jimmy”, said Grandpa, as they stood on line at the local grocery store.  ”What did you learn in school today?”  ”To tell you the truth”, answered young Jimmy, “I’m not exactly sure”.  ”My teacher was going on and on about something called ethics, and I still don’t know what she was talking about!”  Jimmy replied.', 4.5, 11, 'http://www.greatcleanjokes.com/3343/ethics-joke/', 0),
(582, 'Bankruptcy Joke', '“I just can’t take it anymore” cried Larry to his Priest. “No matter how hard I try, I just can’t seem to put bread on the table!”', 2.8, 25, 'http://www.greatcleanjokes.com/3286/bankruptcy-joke/', 0),
(583, 'Working Joke', '“Frank Smith,” announced the judge, “for breaking into a house in the middle of the night, I sentence you to two year in prison.”', 3.4, 15, 'http://www.greatcleanjokes.com/3193/working-joke/', 0),
(584, 'Ark Joke', 'In the year 2010, the Lord came unto Noah, who was now living in the United States, and said: Once again the earth has become wicked and over-populated, and I see the end of all flesh before me.', 4.2, 120, 'http://www.greatcleanjokes.com/2836/ark-joke/', 7),
(585, 'Photographer Joke', 'As a professional photographer, Judy takes a lot of pride in her pictures. Wherever she goes, she brings her pictures with her, to show off her work. “Wow”, said her host Sandra, “these are really nice pictures, you must have a great camera.”  Fuming mad at the implication that her whole talent came from her camera. Judy waited until the end of the meal and then thanked her host, “thank you the meal was delicious,” and then as if an afterthought added, “you must have great pots.”', 3.2, 27, 'http://www.greatcleanjokes.com/2741/photographer-joke/', 0);
